import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About Me</h1>
            <p>Welcome to my portfolio website! I am a passionate developer with experience in web development. I love creating beautiful and functional websites that provide great user experiences.</p>
            <p>On this website, you can explore my projects, learn more about my skills and experience, and get in touch with me. Feel free to browse around and don't hesitate to reach out if you have any questions or opportunities for collaboration.</p>
        </div>
    );
};

export default About;
